import { ThemeOptions } from '@mui/material/styles';

export const themeOptions: ThemeOptions = {
  palette: {
    mode: 'light',
    primary: {
      main: '#F2E3D5',
      light: '#F2E3D5',
    },
    secondary: {
      main: '#877e7e',
    },
    background: {
      paper: '#F2E3D5',
      default: '#D9CBBF',
    },
  },
  spacing: 0,
};
